import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
const Gallery = (props) =>{
    const { mediafile } = props;
    return(
        <Container>
            <Row>
                <Col xs={6} md={4}>
                    <Image src={mediafile.sourceUrl} thumbnail />
                </Col>
            </Row>
            </Container>
    );
}
export default Gallery;
